const Leaderboard = ({ topScores }) => {


  return (
    <div className="leaderboard">
      <table>
          <tr>
            Username
          </tr>
          {topScores.map(score => 
          <li key={score.id}>
            {score.username} {score.time}
          </li>
          )}
      </table>
    </div>
  )
}

export default Leaderboard
